import React from "react";
import './Movies.css';
import ReactDOM from 'react-dom';


function App({ dateTime }) {
    return React.createElement(
      'div',
      {
        style: {
          backgroundColor: 'blue'
        }
      },
      'The current date/time is: ' + dateTime + '!'
    );
    
  
  setInterval(
    () => {
      ReactDOM.render(
        App({
          dateTime: new Date()
        }),
        document.body
      );
    },
    1000
  );
}
export default Bookingpage;
